{"text": ["<li>... that the \"<b><a href=\"/wiki/Lunch_Atop_a_Skyscraper\" title=\"Lunch Atop a Skyscraper\">most famous picture of a lunch break in New York history</a></b>\" <i>(pictured)</i> was actually a <a href=\"/wiki/Publicity_stunt\" title=\"Publicity stunt\">publicity stunt</a>?</li>", "<li>... that when <b><a href=\"/wiki/Nadja_Stefanoff\" title=\"Nadja Stefanoff\">Nadja Stefanoff</a></b> portrayed the title role of Giordano's <i><a href=\"/wiki/Fedora_(opera)\" title=\"Fedora (opera)\">Fedora</a></i> at the <a href=\"/wiki/Oper_Frankfurt\" title=\"Oper Frankfurt\">Oper Frankfurt</a>, one reviewer complimented the brilliance and agility of her voice, assertive even when singing softly?</li>", "<li>... that when a fire broke out next to studios of Oklahoma radio station <b><a href=\"/wiki/KVSO\" title=\"KVSO\">KVSO</a></b>, reporters had to rush in to report the blaze and then out to breathe fresh air?</li>", "<li>... that <b><a href=\"/wiki/Hein_Eersel\" title=\"Hein Eersel\">Hein Eersel</a></b> added \"genuine Surinamese expressions\" in his adaptation of the play <i><a href=\"/wiki/The_Barber_of_Seville_(play)\" title=\"The Barber of Seville (play)\">The Barber of Seville</a></i>?</li>", "<li>... that during <b><a href=\"/wiki/Mayoralty_of_Fiorello_La_Guardia\" title=\"Mayoralty of Fiorello La Guardia\">his mayoralty</a></b>, <a href=\"/wiki/Fiorello_La_Guardia\" title=\"Fiorello La Guardia\">Fiorello La Guardia</a> appointed the first black woman judge in the United States?</li>", "<li>... that railroad transportation executive <b><a href=\"/wiki/William_Phillips_Hall\" title=\"William Phillips Hall\">William Phillips Hall</a></b> was known as the \"business millionaire evangelist\"?</li>", "<li>... that <a href=\"/wiki/Kunt_and_the_Gang\" title=\"Kunt and the Gang\">the band</a> behind <a href=\"/wiki/Boris_Johnson_Is_a_Fucking_Cunt\" title=\"Boris Johnson Is a Fucking Cunt\">two expletive-laden UK top-five singles</a> about <a href=\"/wiki/Boris_Johnson\" title=\"Boris Johnson\">Boris Johnson</a> released <b><a href=\"/wiki/Prince_Andrew_Is_a_Sweaty_Nonce\" title=\"Prince Andrew Is a Sweaty Nonce\">a follow-up about Prince Andrew</a></b>?</li>", "<li>... that we don't know if <b><a href=\"/wiki/Peak_beard\" title=\"Peak beard\">peak beard</a></b> has ended?</li>"]}
