{"text": ["<li><a href=\"/wiki/1199\" title=\"1199\">1199</a> \u2013 <b><a href=\"/wiki/John,_King_of_England\" title=\"John, King of England\">King John</a></b> was crowned at <a href=\"/wiki/Westminster_Abbey\" title=\"Westminster Abbey\">Westminster Abbey</a>.</li>", "<li><a href=\"/wiki/1799\" title=\"1799\">1799</a> \u2013 <a href=\"/wiki/War_of_the_Second_Coalition\" title=\"War of the Second Coalition\">War of the Second Coalition</a>: Austrian forces defeated the French <a href=\"/wiki/Army_of_the_Danube\" title=\"Army of the Danube\">Army of the Danube</a>, <b><a href=\"/wiki/Battle_of_Winterthur\" title=\"Battle of Winterthur\">capturing the strategically important Swiss town</a></b> of <a href=\"/wiki/Winterthur\" title=\"Winterthur\">Winterthur</a>.</li>", "<li><a href=\"/wiki/1917\" title=\"1917\">1917</a> \u2013 <a href=\"/wiki/Pope_Benedict_XV\" title=\"Pope Benedict XV\">Pope Benedict\u00a0XV</a> <i>(pictured)</i> promulgated the <b><a href=\"/wiki/1917_Code_of_Canon_Law\" title=\"1917 Code of Canon Law\">Pio-Benedictine Code</a></b>, the first official comprehensive codification of <a href=\"/wiki/Canon_law_of_the_Catholic_Church\" title=\"Canon law of the Catholic Church\">Latin canon law</a>.</li>", "<li><a href=\"/wiki/1962\" title=\"1962\">1962</a> \u2013 A fire at a <a href=\"/wiki/Landfill\" title=\"Landfill\">landfill</a> in <a href=\"/wiki/Centralia,_Pennsylvania\" title=\"Centralia, Pennsylvania\">Centralia, Pennsylvania</a>, <b><a href=\"/wiki/Centralia_mine_fire\" title=\"Centralia mine fire\">spread to an abandoned coal mine</a></b>, where it continues burning today.</li>", "<li><a href=\"/wiki/2006\" title=\"2006\">2006</a> \u2013 <b><a href=\"/wiki/2006_Yogyakarta_earthquake\" title=\"2006 Yogyakarta earthquake\">An earthquake</a></b> registering 6.4\u00a0<a href=\"/wiki/Moment_magnitude_scale\" title=\"Moment magnitude scale\">M<sub>w</sub></a> struck near the city of <a href=\"/wiki/Yogyakarta\" title=\"Yogyakarta\">Yogyakarta</a> on the southern side of the Indonesian island of <a href=\"/wiki/Java\" title=\"Java\">Java</a>, killing more than 5,700 people.</li>"]}
